import React from "react";
import {MDBBtn,MDBTable,MDBTableBody,} from "mdb-react-ui-kit";
import ListGroup from 'react-bootstrap/ListGroup';

const Filter = (props) => {
  let i=0
  const finish=(e)=>{

    e.preventDefault()
    props.todos.isDone==='Done'

  }
  const status=()=>{
if(props.todos.isDone==='Done')
{
  return 'Complete'
}
else if (props.todos.isDone==='Not-Yet')
  {
    return 'In progress'
  }
}
  
    return (
      <>
      { props.searchfilter === "Done" ? props.todos
      .filter((todo) => {
        return todo.isDone === true;
      })
      .map((todo) => (  
                         <MDBTable className="mb-4">
                         <MDBTableBody>
      <tr>
        <th scope="row">{i+1}</th>
        <td>{todo.description}</td>
        <td>Complete</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>

        </td>
      </tr>
                                 </MDBTableBody>
                         
                         </MDBTable>
                      )
                    )

                    : props.searchfilter === "Not-Yet" ? props.todos
      .filter((todo) => {
        return todo.isDone === false;
      })
      .map((todo) => (
                 <MDBTable className="mb-4">
                                 <MDBTableBody>
      <tr>
        <th scope="row">{i+1}</th>
        <td>{todo.description}</td>
        <td>In progress</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>
          <MDBBtn type="submit" color="success" className="ms-1">
            Finished
          </MDBBtn>

        </td>
      </tr>
                                 </MDBTableBody>
                         
                         </MDBTable>
      ))

      
      : props.todos.map((todo) => (
        <MDBTable className="mb-4">
        <MDBTableBody>
<tr>
<th scope="row">{i+1}</th>
<td>{todo.description}</td>
<td>{todo.isDone===true ? "Complete":"In progress"}</td>
<td>
<MDBBtn type="submit" color="danger">
Delete
</MDBBtn>
{todo.isDone===true?
<MDBBtn type="submit" color="success" className="ms-1">
Done
</MDBBtn>:<MDBBtn type="submit" color="success" className="ms-1">
Finished
</MDBBtn>}


</td>
</tr>
        </MDBTableBody>

        </MDBTable>

             ))

             }
             </>
           );


}
         
export default Filter ;
